import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <div className ='nav'>
            <Link to="/" className='link'>Home</Link>
            <Link to="/usercards" >User Card</Link>
            <Link to="/followers">Followers</Link>
        </div>
    )
}

export default Nav
